const switchSensorUsed = ['Inner (IN)', 'All (AL)', 'Outer (OU)'];

const fzLocal = {
  thermostat_child_lock: {
    cluster: 'hvacUserInterfaceCfg',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.keypadLockout !== undefined) {
            // Set as child lock instead as keypadlockout
            result.child_lock = msg.data['keypadLockout'] === 1 ? 'Lock' : 'Unlock';
        }
        return result;
    },
  },
  thermostat_sensor_used: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        const data = msg.data;
        if (data[0xF000] !== undefined) {
            const lookup = {0: 'Inner (IN)', 1: 'All (AL)', 2: 'Outer (OU)'};
            result.sensor = lookup[data[0xF000]];
        }
        return result;
    },
  },
  thermostat_deadzone: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty('minSetpointDeadBand')) {
          const data = parseInt(msg.data['minSetpointDeadBand']);
          result.deadzone_temperature = data;
        }
        return result;
    },
  },
  thermostat_frost_protect: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(0xF001)) {
          const data = parseInt(msg.data[0xF001]) / 100;
          result.frost_protect = data;
        }
        return result;
    },
  },
  thermostat_heat_protect: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(0xF002)) {
          const data = parseInt(msg.data[0xF002]) / 100;
          result.heat_protect = data;
        }
        return result;
    },
  },
};


const tzLocal = {
  display_brightness: {
    key: ['brightness'],
    options: [exposes.options.transition()],
    convertSet: async (entity, key, value, meta) => {
      await entity.command('genLevelCtrl', 'moveToLevel', {level: value, transtime: 0}, utils.getOptions(meta.mapped, entity));
      return {state: {brightness: value}};
    },
    convertGet: async (entity, key, meta) => {
      await entity.read('genLevelCtrl', ['currentLevel']);
    },
  },
	thermostat_child_lock: {
    key: ['child_lock'],
    convertSet: async (entity, key, value, meta) => {
      const keypadLockout = Number(value === 'Lock');
      await entity.write('hvacUserInterfaceCfg', {keypadLockout});
      return {readAfterWriteTime: 250, state: {child_lock: value}};
    },
    convertGet: async (entity, key, meta) => {
      await entity.read('hvacUserInterfaceCfg', ['keypadLockout']);
    },
	},
  thermostat_sensor_used: {
    key: ['sensor'],
    convertSet: async (entity, key, rawValue, meta) => {
      const endpoint = meta.device.getEndpoint(1);
      const value = switchSensorUsed.indexOf(rawValue);
      const payloads = {
        sensor: ['hvacThermostat', {0xf000: {value, type: 0x30}}],
      };
      await endpoint.write(payloads[key][0], payloads[key][1]);
      return {
        state: {[key]: rawValue},
      };
    },
    convertGet: async (entity, key, meta) => {
      await entity.read('hvacThermostat', [0xf000]);
    },
  },
  thermostat_deadzone: {
    key: ['deadzone_temperature'],
    convertSet: async (entity, key, value, meta) => {
      const minSetpointDeadBand = parseInt(value, 10);
      await entity.write('hvacThermostat', {minSetpointDeadBand});
      return {readAfterWriteTime: 250, state: {minSetpointDeadBand: value}};
    },
    convertGet: async (entity, key, meta) => {
      await entity.read('hvacThermostat', ['minSetpointDeadBand']);
    },
  },
  thermostat_frost_protect: {
    key: ['frost_protect'],
    convertSet: async (entity, key, value, meta) => {
      if (!utils.isInRange(0, 10, value))
        throw new Error(`Invalid value: ${value} (expected ${0} to ${10})`);      
      const frost_protect = parseInt(value, 10) * 100;
      await entity.write('hvacThermostat', {0xf001: {value: frost_protect, type: 0x29}})
      return {readAfterWriteTime: 250, state: {frost_protect: value}};
    },
    convertGet: async (entity, key, meta) => {
      await entity.read('hvacThermostat', [0xf001]);
    },
  },
  thermostat_heat_protect: {
    key: ['heat_protect'],
    convertSet: async (entity, key, value, meta) => {
      if (!utils.isInRange(25, 70, value))
        throw new Error(`Invalid value: ${value} (expected ${25} to ${70})`);      
      const heat_protect = parseInt(value, 10) * 100;
      await entity.write('hvacThermostat', {0xf002: {value: heat_protect, type: 0x29}});
      return {readAfterWriteTime: 250, state: {heat_protect: value}};
    },
    convertGet: async (entity, key, meta) => {
      await entity.read('hvacThermostat', [0xf002]);
    },
  },
  thermostat_setpoint_raise_lower: {
    key: ['setpoint_raise_lower'],
    convertSet: async (entity, key, value, meta) => {
      if (!utils.isInRange(-5, 5, value))
        throw new Error(`Invalid value: ${value} (expected ${-5} to ${5})`);      
      const setpoint_raise_lower = parseInt(value, 10) * 10; //Step 0.1°C. 5°C - 50, 1°C - 10 etc.
      await entity.command('hvacThermostat', 'setpointRaiseLower', {'mode': 0, 'amount': setpoint_raise_lower});
      return {readAfterWriteTime: 250, state: {setpoint_raise_lower: value}};
    },
  },
};


